import { useState } from 'react';
import './App.css';
import Axios from "axios";

function App() {

  const[data,setData] = useState([]);

  async function getter(req,res){
        const r = await Axios.get("http://localhost:3022/").then((r)=>{
          setData(r.data)
        })
  };

  return (
    <div className="App">
      <form onSubmit={getter}>
        <p>{data}</p>
      </form>
    </div>
  );
}

export default App;
